import styled from 'styled-components';
import {Container} from '../index';
import Title1 from '../Title1';

const Content = styled.div``;

class Main extends React.Component {
    constructor(props) {
        super(props);
        this.state = {};
    }

    render() {
        return (
            <Container>
                <Content>
                    <Title1>Interactive Design</Title1>
                </Content>
            </Container>
        );
    }
}

export default Main;
